const Book = ((book)=>{

    return (
        <>
            <div className="list">

                <center><div className="book">
                    {book.cover && <img src = {book.cover} alt ="/" width="200px" height="250px" />}
                    <h2>{book.title}</h2>
                    <h3>{book.desc}</h3>
                </div>
                </center>
            </div>
        </>
    )
})
export default Book
